INSERT INTO `posts` (`id`, `createdate`, `modifydate`, `title`, `author`, `email`, `likes`, `last_like_ip`, `post_category`, `post_photo1`, `post_txt`, `post_keyword1`, `post_keyword2`, `post_keyword3`, `post_link1_url`, `post_link2_url`, `post_link3_url`, `post_link1_title`, `post_link2_title`, `post_link3_title`, `post_status`, `nviews`) VALUES
(1, '2016-06-03 00:00:00', '2016-06-03 00:00:00', 'Магазин Crystal Sky -Серебро 925 Камни', 'Crystal Sky', '', 4, '216.72.35.217', 'Общая', 'app_data/app_images/post1_img.jpg', 'Дорогие  Друзья! В магазине "Crystal Sky" вы сможете найти регулярно пополняемый ассортимент оригинальных изделий из серебра. \n\nУкрашения с полудрагоценными камнями, позолоты и многое другое... Приглашаем!', 'серебряные', 'украшения', 'камни', '', '', '', '', '0', '0', '1', 53),
(2, '2016-06-03 10:16:52', '2016-06-03 10:16:52', 'магазин Crystal Sky', 'Crystal Sky', '', 2, '46.116.193.160', 'Общая', 'app_data/app_images/post1_img.jpg', 'Магазин ювелирных изделий "Crystal Sky" — это продажа изделий из серебра 925° и богатый выбор серебряных украшений для Ваc по самой выгодной цене! Ювелирные серебряные украшения "Crystal Sky" созданы для того, чтобы в любой ситуации Вы могли подчеркнуть свой собственный стиль. Мы понимаем, как важно для Вас сохранить свою индивидуальность.\r\n\r\nВыбор драгоценностей, который мы предлагаем Вам, уникален, ведь новые модели из серебра появляются у нас на постоянной основе, предлагаем посмотреть новые коллекции украшений из серебра!\r\n\r\nМы следуем тенденциям и потому знаем, что сегодня ни один модный образ невозможен без натуральных драгоценных и полудрагоценных камней. Они наполняют особой магией изделия и украшения из серебра. Цвет и блеск натуральных рубинов, топазов, александритов, сапфиров, аметистов … и многих других камней в серебряных украшениях от магазина "Crystal Sky" становятся изящным акцентом Вашего образа. Серебряная оправа ювелирных изделий тонко подчеркивает природную роскошь камня и моделирует неповторимый стиль ювелирной шикарной коллекции.\r\n\r\nСеребряные украшения отличаются утонченным и изысканным внешним видом. Они прекрасно дополнят как вечерний наряд, так и повседневные джинсы и футболку. Серебряные сережки, цепочки, кольца, подвески и браслеты могут стать прекрасным подарком. В ассортименте магазина "Crystal Sky" большой выбор украшений из серебра на любой вкус. Приобретая серебряные ювелирные изделия в нашем магазине, Вы непременно будете довольны!', 'украшения из серебра', 'натуральные камни', 'позолота', '', '', '', '', '', '', '1', 34),
(3, '2016-06-03 10:23:48', '2016-06-03 10:23:48', 'Магазин Crystal Sky -Серебро 925 Камни', 'Crystal Sky', '', 2, '46.116.193.160', 'Общая', 'app_data/app_images/post4_img.jpg', 'Дорогие Друзья Приглашаем Вас в Магазин *Crystal Sky* У нас сейчас скидка 20 - 50 % на все изделия из натуральных камней!', 'украшения из серебра', 'натуральные камни', 'позолота', '', '', '', '', '', '', '1', 13),
(4, '2016-06-03 14:44:08', '2016-06-03 14:44:08', 'Магазин Crystal Sky -Серебро 925 Камни', 'Crystal Sky', '', 1, '46.116.193.160', 'Общая', 'app_data/app_images/post3_img.jpg', 'Дорогие Друзья Приглашаем Вас в Магазин Crystal Sky!', 'украшения из серебра', 'натуральные камни', 'позолота', '', '', '', '', '', '', '1', 8),
(7, '2016-06-09 23:08:14', '2016-06-10 00:00:57', 'Цитаты Коко Шанель', 'Crystal Sky', '', 1, '85.250.131.106', 'Интересно', 'app_data/app_images/20160609_235450_851220_coco_chanel_photo.jpg', 'Коко́ Шане́ль (фр. Coco Chanel, настоящее имя Габриэ́ль Бонёр Шане́ль, фр. Gabrielle Bonheur Chanel; 19 августа 1883, Сомюр — 10 января 1971, Париж) — французский модельер, основавшая модный дом Chanel и оказавшая колоссальное влияние на моду XX века\r\n\r\nМне наплевать, что вы обо мне думаете. Я о вас не думаю вообще.\r\n\r\nЗаботясь о красоте, надо начинать с сердца и души, иначе никакая косметика не поможет!!!\r\n\r\nВ двадцать лет у вас лицо, которое дала вам природа;\r\nв тридцать лет у вас лицо, которое вылепила вам жизнь;\r\nа в пятьдесят у вас лицо, которого вы заслуживаете.\r\n\r\nВсе в наших руках, поэтому их нельзя опускать.\r\n\r\nУ вас не будет второго шанса, чтобы произвести первое впечатление.\r\n\r\nЧтобы быть незаменимой, нужно все время меняться.\r\n\r\nПарадокс: чем глупее и не удачливее мужчина, тем у него больше претензий к женщине…\r\n\r\nСтарость не защищает от любви, но любовь защищает от старости.\r\n\r\nМужчина, способный на поступки, обречен быть любимым.\r\n\r\nСдерживать себя, когда обидно, и не устраивать сцен, когда больно — вот что такое идеальная женщина.\r\n\r\nЕсли вас поразила красотой какая-нибудь женщина, но вы не можете вспомнить, во что она была одета, — значит, она была одета идеально.\r\n\r\nЕсли ты рожден без крыльев, не мешай им расти.\r\n\r\nКрасивые глаза только у того, \r\nкто смотрит на тебя с нежностью…\r\n\r\nЛучший модный аксессуар женщины-красивый мужчина!\r\n', 'цитаты', 'коко', 'шанель', '', '', '', '', '', '', '1', 13),
(8, '2016-06-10 00:30:52', '2016-06-10 00:30:52', 'Серебряные украшения для красоты и здоровья!', 'Crystal Sky', '', 1, '85.250.131.106', 'Интересно', 'app_data/app_images/20160610_003052_898970_k2.jpg', 'Целебные свойства серебра известны из давних времен. Этот эффектный и красивый металл готов прийти на помощь человеку и в праздники, и в будни. Каждому человеку важно здоровье и красота. Целебные свойства серебра издавна используются в гинекологии, дерматологии, стоматологии, и не только.\r\n\r\nСуществует такой обычай – дарить серебряную ложечку младенцу. Еще в древние времена, люди были уверены в том, что такой предмет прекрасно очистит и воду, и пищу.\r\n\r\nВ традициях многих народов именно серебро – светлый металл, связывали с Луной и женским началом, наделяя его мистическими свойствами. Бывали времена, когда серебро ценилось намного больше золота; оно стоило дороже. В настоящее время серебро имеет очень широкое применение. Если вспомнить, ни одна электронная техника немыслима без серебра. С помощью серебра лечат поверхностные инфекции. И с помощью серебра очищают воду.\r\n\r\nАнтибактериальные свойства серебра известны людям с давних времен. Это можно подметить еще с XIII века. Ведь именно в то далекое время уже многие состоятельные люди заказывали серебряную посуду для празднований застолий, различных праздников, вечеринок. \r\n\r\nЕсли человек отправлялся в дальнюю дорогу, то там не всегда можно было найти воду, которая была бы безопасной для питья. В этом случае прекрасно пригодится серебряная фляжка.\r\n\r\nСеребряная вода очень легко готовится. Для такой воды необходим просто простой бытовой ионизатор, с помощью которого можно достигнуть около трех разных концентраций воды. Известно, ', 'целебные', 'свойства', 'серебра', '', '', '', '', '', '', '1', 4);
